import React from 'react';
import Button from '@material-ui/core/Button';
import '../node_modules/bootstrap/dist/css/bootstrap.min.css';
 


const Gnote = () => {

    return(
            <>
                <div className="main">
                    <form className="for">
                    
                        <input type="text" className="in" placeholder="Title"/><br/>
                        <textarea className="tex" row="" column="" placeholder="write a note..."></textarea>
                        </form>
                        <br/>
                    <Button className="bt2">+</Button>
                </div>
            </>
    );
}

export default Gnote;
